import React from "react";
import { Route ,Routes } from "react-router-dom";
import Header from "./components/Header";
import Main from "./components/Main";

const App = () => {
  return (
    <div className="App">
      <Header></Header>
    <Routes>

      <Route  path="/" element={<Main />}></Route>
    </Routes>
    </div>
  );
};

export default App;
